import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Table } from "react-bootstrap";
import "./styles.scss";

const UsuariosForm = () => {
  const headTable = [
    "Nombres",
    "Apellidos",
    "Identificacion (C.C)",
    "Rol Asociado",
    "Estado",
    "Teléfono",
    "CorreoElectronico",
    "Accion",
  ];

  const userTable = [
    "Alejandro",
    "Guespud",
    "111365478",
    "Admin",
    "Activo",
    "31695447",
    "admin@gmail.com",
    `${<img src="https://img.icons8.com/small/10/000000/edit.png"/>}${<img src="https://img.icons8.com/material/10/000000/delete-forever--v1.png"/>}`,
  ];

  return (
    <div>
      <Table responsive>
        <thead>
          <tr>
            {Array.from(headTable).map((_, index) => (
              <th key={index}>{_}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            {Array.from(userTable).map((_, index) => (
              <td key={_}>{_}</td>
            ))}
          </tr>
          <tr>
            {Array.from({ length: 8 }).map((_, index) => (
              <td key={index}>Table cell {index}</td>
            ))}
          </tr>
          <tr>
            {Array.from({ length: 8 }).map((_, index) => (
              <td key={index}>Table cell {index}</td>
            ))}
          </tr>
        </tbody>
      </Table>
    </div>
  );
};

export default UsuariosForm;
